-- Index for participants_events filtering and grouping
CREATE INDEX idx_participants_events_participant_id 
ON participants_events(participant_id);

-- Index for stats subquery filtering
CREATE INDEX idx_stats_holder_lookup 
ON stats(stat_holder_id, stat_holder_type) 
WHERE stat_holder_type = 'persons';

-- Composite index for stat_repository_type counting
CREATE INDEX idx_stats_repository_type_lookup 
ON stats(stat_holder_id, stat_holder_type, stat_repository_type) 
WHERE stat_holder_type = 'persons';

-- Index for events join on participants_events
CREATE INDEX idx_participants_events_event_id 
ON participants_events(event_id);

-- Index for events table to optimize date lookup
CREATE INDEX idx_events_id_start_date 
ON events(id, start_date_time);

-- Composite index for the last_event_date subquery optimization
CREATE INDEX idx_participants_events_participant_event_composite 
ON participants_events(participant_id, event_id);
"}
